import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import './style.css';
import Paskagg from './paskagg.js';
import Script from './script.js';

ReactDOM.render(
  <React.StrictMode>
    <Paskagg /> 
    <Script /> 
    <App /> 
  </React.StrictMode>,
  document.getElementById('App')
);
